import React from 'react';
import Banner from './../Banner';
import Article from './../Article';
import { ReactFloatingBalloons } from '../../Balloons';
import firebase from "firebase/compat/app"
import "firebase/compat/auth"
import "firebase/compat/firestore"

const Welcome = () => {
  const firebaseApp = firebase.apps[0]
  return (
    <div>
      <main className="main-content bg-gray">
        <div className="col-lg-6 offset-lg-3">
          <img className="dog" src={`${process.env.PUBLIC_URL}/assets/img/fish/dog.png`} alt="dog" />
          <p>Welcome to Becca Shapiro's website</p>
          <img className="dog" src={`${process.env.PUBLIC_URL}/assets/img/fish/cat.png`} alt="dog" />
        </div>
        <div className="row">
          <div className="col-12 col-lg-6 offset-lg-3">
            <div style={{ position: 'relative', zIndex: 100 }} >
              < ReactFloatingBalloons />
            </div>
          </div>
        </div>
      </main>

    </div>
  );
};

export default Welcome;
